import React from 'react';
import { List, Button } from 'antd';

const FollowList = ({ header, data }) => {
  return (
    <List
      style={{ marginBottom: 20 }}
      grid={{ gutter: 4, xs: 2, md: 3 }}
      size="small"
      header={<div>header</div>}
      loadMore={
        <div style={{ textAlign: 'center' }}>
          <Button>더 보기</Button>
        </div>
      }
    />
  );
};

export default FollowList;
